      b 13.06.1922 d 19.08.1995
      Dinah was educated at Woodford House. She worked in the cipher office during WW2 and later worked for
      the International Refugee Organisation in Switzerland. She obtained her pilot's licence after the war
      and flew for the Tauranga Aero Club.
      John was born in England. He served in the British Army during WW2 then moved to New Zealand in 1947.
      He worked for the "Auckland Star" for many years and began teaching in 1964.
